"use strict";(self.webpackChunkajudafacitysistemas=self.webpackChunkajudafacitysistemas||[]).push([[7178],{78:(s,e,a)=>{a.r(e),a.d(e,{assets:()=>r,contentTitle:()=>i,default:()=>m,frontMatter:()=>n,metadata:()=>p,toc:()=>l});var o=a(4848),t=a(8453);const n={title:"Novas vari\xe1veis dispon\xedveis no Bot para fornecer informa\xe7\xf5es atualizadas do sistema"},i=void 0,p={id:"cadastros/novas-variaveis-disponiveis-no-bot-para-fornecer-informacoes-atualizadas-do-sistema",title:"Novas vari\xe1veis dispon\xedveis no Bot para fornecer informa\xe7\xf5es atualizadas do sistema",description:"<div dangerouslySetInnerHTML={{ html: `",source:"@site/docs/cadastros/novas-variaveis-disponiveis-no-bot-para-fornecer-informacoes-atualizadas-do-sistema.mdx",sourceDirName:"cadastros",slug:"/cadastros/novas-variaveis-disponiveis-no-bot-para-fornecer-informacoes-atualizadas-do-sistema",permalink:"/ajudafacitysistemas/en/docs/cadastros/novas-variaveis-disponiveis-no-bot-para-fornecer-informacoes-atualizadas-do-sistema",draft:!1,unlisted:!1,editUrl:"https://github.com/ajudafacity/ajudafacitysistemas/edit/main/docs/cadastros/novas-variaveis-disponiveis-no-bot-para-fornecer-informacoes-atualizadas-do-sistema.mdx",tags:[],version:"current",frontMatter:{title:"Novas vari\xe1veis dispon\xedveis no Bot para fornecer informa\xe7\xf5es atualizadas do sistema"},sidebar:"tutorialSidebar",previous:{title:"Mapa de URLS para Facebook Pixel",permalink:"/ajudafacitysistemas/en/docs/cadastros/mapa-de-urls-para-facebook-pixel"},next:{title:"Como configurar hor\xe1rio de atendimento?",permalink:"/ajudafacitysistemas/en/docs/configuracoes/como-configurar-horario-de-atendimento-"}},r={},l=[];function c(s){return(0,o.jsx)(o.Fragment,{children:(0,o.jsx)(o.Fragment,{children:(0,o.jsx)("div",{dangerouslySetInnerHTML:{__html:'\n  \n<p></p>\n\n\n\n<p class="has-small-font-size"> Entendendo as vari\xe1veis dispon\xedveis, as vari\xe1veis dispon\xedveis s\xe3o as seguintes:</p>\n\n\n\n<ol class="has-small-font-size wp-block-list"><li><strong>[openinghours]</strong>: Essa vari\xe1vel permite exibir os hor\xe1rios de funcionamento do estabelecimento.</li><li><strong>[deliverytime]</strong>: Utilize essa vari\xe1vel para mostrar o tempo estimado de entrega para pedidos de delivery, em horas.</li><li><strong>[withdrawaltime]</strong>: Essa vari\xe1vel mostra o tempo estimado de retirada de pedidos, em horas.</li><li><strong>[deliverytimeminutes]</strong>: Utilize essa vari\xe1vel para mostrar o tempo estimado de entrega para pedidos de delivery, em minutos.</li><li><strong>[withdrawaltimeminutes]</strong>: Essa vari\xe1vel mostra o tempo estimado de retirada de pedidos, em minutos.</li><li><strong>[companyaddress]</strong>: Utilize essa vari\xe1vel para exibir o endere\xe7o da empresa.</li><li><strong>[webappurl]</strong>: Essa vari\xe1vel cont\xe9m a URL do aplicativo.</li><li><strong>[sendername]</strong>: Utilize essa vari\xe1vel para obter o nome informado pelo cliente atrav\xe9s do WhatsApp.</li></ol>\n\n\n\n<p class="has-small-font-size">Para usar as vari\xe1veis, segue um passo a passo:</p>\n\n\n\n<p class="has-small-font-size"><strong>Passo 1:&nbsp;</strong>Abra o<strong>&nbsp;Facity Controle</strong>&nbsp;em seu computador</p>\n\n\n\n<p class="has-small-font-size">Digite o&nbsp;<strong>nome da empresa</strong>,&nbsp;<strong>login</strong>&nbsp;e&nbsp;<strong>senha</strong>, lembrando que tudo deve ser em<em>&nbsp;letras min\xfasculas</em>.</p>\n\n\n\n<figure class="wp-block-image size-full"><img style="max-width: 100%; height: auto;" loading="lazy" decoding="async" width="900" height="547" src="https://blog.facity.com.br/wp-content/uploads/2023/06/image.png" alt="" class="wp-image-1402" srcset="https://blog.facity.com.br/wp-content/uploads/2023/06/image.png 900w, https://blog.facity.com.br/wp-content/uploads/2023/06/image-300x182.png 300w, https://blog.facity.com.br/wp-content/uploads/2023/06/image-768x467.png 768w, https://blog.facity.com.br/wp-content/uploads/2023/06/image-720x438.png 720w" sizes="(min-width: 960px) 75vw, 100vw" /></figure>\n\n\n\n<p class="has-small-font-size"><strong>Passo 2: </strong>Navegue at\xe9 o menu <strong>&#8220;Marketing&#8221;</strong></p>\n\n\n\n<p class="has-small-font-size">No painel do Facity Controle, encontre e clique na op\xe7\xe3o <strong>&#8220;Marketing&#8221;</strong>. Em seguida, dentro do menu <strong>&#8220;Marketing&#8221;</strong>, procure pela op\xe7\xe3o <strong>&#8220;Auto Respostas&#8221; </strong>e clique nela.</p>\n\n\n\n<figure class="wp-block-image size-large"><img style="max-width: 100%; height: auto;" loading="lazy" decoding="async" width="1024" height="391" src="https://blog.facity.com.br/wp-content/uploads/2023/06/1-1-1024x391.png" alt="" class="wp-image-1404" srcset="https://blog.facity.com.br/wp-content/uploads/2023/06/1-1-1024x391.png 1024w, https://blog.facity.com.br/wp-content/uploads/2023/06/1-1-300x114.png 300w, https://blog.facity.com.br/wp-content/uploads/2023/06/1-1-768x293.png 768w, https://blog.facity.com.br/wp-content/uploads/2023/06/1-1-720x275.png 720w, https://blog.facity.com.br/wp-content/uploads/2023/06/1-1.png 1316w" sizes="(min-width: 960px) 75vw, 100vw" /></figure>\n\n\n\n<p class="has-small-font-size"><strong>Passo 3:</strong> Adicione as novas vari\xe1veis \xe0s auto respostas</p>\n\n\n\n<p class="has-small-font-size">Agora vem a parte importante! Na tela das <strong>&#8220;Auto Respostas&#8221;</strong>, voc\xea ver\xe1 um \xedcone em azul para adicionar novas respostas. Clique nesse \xedcone para come\xe7ar a criar as suas auto respostas e incluir as novas vari\xe1veis.</p>\n\n\n\n<figure class="wp-block-image size-large"><img style="max-width: 100%; height: auto;" loading="lazy" decoding="async" width="1024" height="473" src="https://blog.facity.com.br/wp-content/uploads/2023/07/primoexemploautorespostas-1024x473.png" alt="" class="wp-image-1422" srcset="https://blog.facity.com.br/wp-content/uploads/2023/07/primoexemploautorespostas-1024x473.png 1024w, https://blog.facity.com.br/wp-content/uploads/2023/07/primoexemploautorespostas-300x139.png 300w, https://blog.facity.com.br/wp-content/uploads/2023/07/primoexemploautorespostas-768x355.png 768w, https://blog.facity.com.br/wp-content/uploads/2023/07/primoexemploautorespostas-720x332.png 720w, https://blog.facity.com.br/wp-content/uploads/2023/07/primoexemploautorespostas.png 1228w" sizes="(min-width: 960px) 75vw, 100vw" /></figure>\n\n\n\n<p class="has-small-font-size"><strong>Passo 4: </strong>Exemplo de como colocar as vari\xe1veis</p>\n\n\n\n<p class="has-small-font-size">Todas as vari\xe1veis est\xe3o no inicio do post \u261d</p>\n\n\n\n<figure class="wp-block-image size-large"><img style="max-width: 100%; height: auto;" loading="lazy" decoding="async" width="1024" height="422" src="https://blog.facity.com.br/wp-content/uploads/2023/07/exemplo-de-variaveis--1024x422.png" alt="" class="wp-image-1423" srcset="https://blog.facity.com.br/wp-content/uploads/2023/07/exemplo-de-variaveis--1024x422.png 1024w, https://blog.facity.com.br/wp-content/uploads/2023/07/exemplo-de-variaveis--300x124.png 300w, https://blog.facity.com.br/wp-content/uploads/2023/07/exemplo-de-variaveis--768x317.png 768w, https://blog.facity.com.br/wp-content/uploads/2023/07/exemplo-de-variaveis--720x297.png 720w, https://blog.facity.com.br/wp-content/uploads/2023/07/exemplo-de-variaveis-.png 1337w" sizes="(min-width: 960px) 75vw, 100vw" /></figure>\n\n\n\n<p class="has-small-font-size"><strong>Alguns exemplos de vari\xe1veis:</strong></p>\n\n\n\n<figure class="wp-block-image size-large"><img style="max-width: 100%; height: auto;" loading="lazy" decoding="async" width="1024" height="512" src="https://blog.facity.com.br/wp-content/uploads/2023/07/primoexemploautorespostas-1-1024x512.png" alt="" class="wp-image-1426" srcset="https://blog.facity.com.br/wp-content/uploads/2023/07/primoexemploautorespostas-1-1024x512.png 1024w, https://blog.facity.com.br/wp-content/uploads/2023/07/primoexemploautorespostas-1-300x150.png 300w, https://blog.facity.com.br/wp-content/uploads/2023/07/primoexemploautorespostas-1-768x384.png 768w, https://blog.facity.com.br/wp-content/uploads/2023/07/primoexemploautorespostas-1-720x360.png 720w, https://blog.facity.com.br/wp-content/uploads/2023/07/primoexemploautorespostas-1.png 1058w" sizes="(min-width: 960px) 75vw, 100vw" /></figure>\n\n\n\n<p class="has-small-font-size"> 1.<strong>[companyaddress]</strong>: Utilize essa vari\xe1vel para exibir o endere\xe7o da empresa.</p>\n\n\n\n<figure class="wp-block-image size-large"><img style="max-width: 100%; height: auto;" loading="lazy" decoding="async" width="1024" height="486" src="https://blog.facity.com.br/wp-content/uploads/2023/07/exemplo-de-variaveis-2-1024x486.png" alt="" class="wp-image-1427" srcset="https://blog.facity.com.br/wp-content/uploads/2023/07/exemplo-de-variaveis-2-1024x486.png 1024w, https://blog.facity.com.br/wp-content/uploads/2023/07/exemplo-de-variaveis-2-300x142.png 300w, https://blog.facity.com.br/wp-content/uploads/2023/07/exemplo-de-variaveis-2-768x364.png 768w, https://blog.facity.com.br/wp-content/uploads/2023/07/exemplo-de-variaveis-2-720x342.png 720w, https://blog.facity.com.br/wp-content/uploads/2023/07/exemplo-de-variaveis-2.png 1132w" sizes="(min-width: 960px) 75vw, 100vw" /></figure>\n\n\n\n<p class="has-small-font-size">   2. <strong>[openinghours]</strong>: Essa vari\xe1vel permite exibir os hor\xe1rios de funcionamento do estabelecimento.</p>\n\n\n\n<figure class="wp-block-image size-full is-resized"><img style="max-width: 100%; height: auto;" loading="lazy" decoding="async" src="https://blog.facity.com.br/wp-content/uploads/2023/07/horariodefuncionamentoexemplo.png" alt="" class="wp-image-1433" width="920" height="600" srcset="https://blog.facity.com.br/wp-content/uploads/2023/07/horariodefuncionamentoexemplo.png 819w, https://blog.facity.com.br/wp-content/uploads/2023/07/horariodefuncionamentoexemplo-300x196.png 300w, https://blog.facity.com.br/wp-content/uploads/2023/07/horariodefuncionamentoexemplo-768x501.png 768w, https://blog.facity.com.br/wp-content/uploads/2023/07/horariodefuncionamentoexemplo-720x469.png 720w" sizes="(min-width: 960px) 75vw, 100vw" /></figure>\n\n\n\n<p class="has-small-font-size">   3. <strong>[deliverytime]</strong>: Utilize essa vari\xe1vel para mostrar o tempo estimado de entrega para pedidos de delivery, em horas.</p>\n\n\n\n<figure class="wp-block-image size-full"><img style="max-width: 100%; height: auto;" loading="lazy" decoding="async" width="982" height="532" src="https://blog.facity.com.br/wp-content/uploads/2023/07/exemplo-de-variaveis-3.png" alt="" class="wp-image-1428" srcset="https://blog.facity.com.br/wp-content/uploads/2023/07/exemplo-de-variaveis-3.png 982w, https://blog.facity.com.br/wp-content/uploads/2023/07/exemplo-de-variaveis-3-300x163.png 300w, https://blog.facity.com.br/wp-content/uploads/2023/07/exemplo-de-variaveis-3-768x416.png 768w, https://blog.facity.com.br/wp-content/uploads/2023/07/exemplo-de-variaveis-3-720x390.png 720w" sizes="(min-width: 960px) 75vw, 100vw" /></figure>\n\n\n\n<p class="has-small-font-size">   4. <strong>[withdrawaltimeminutes]</strong>: Essa vari\xe1vel mostra o tempo estimado de retirada de pedidos, em minutos.</p>\n\n\n\n<figure class="wp-block-image size-full is-resized"><img style="max-width: 100%; height: auto;" loading="lazy" decoding="async" src="https://blog.facity.com.br/wp-content/uploads/2023/07/exemplo-de-variaveis-5.png" alt="" class="wp-image-1429" width="919" height="523" srcset="https://blog.facity.com.br/wp-content/uploads/2023/07/exemplo-de-variaveis-5.png 879w, https://blog.facity.com.br/wp-content/uploads/2023/07/exemplo-de-variaveis-5-300x170.png 300w, https://blog.facity.com.br/wp-content/uploads/2023/07/exemplo-de-variaveis-5-768x436.png 768w, https://blog.facity.com.br/wp-content/uploads/2023/07/exemplo-de-variaveis-5-720x409.png 720w" sizes="(min-width: 960px) 75vw, 100vw" /></figure>\n\n\n\n<p class="has-small-font-size">       5. <strong>[deliverytimeminutes]</strong>: Utilize essa vari\xe1vel para mostrar o tempo estimado de entrega para pedidos de delivery, em minutos.</p>\n\n\n\n<figure class="wp-block-image size-full is-resized"><img style="max-width: 100%; height: auto;" loading="lazy" decoding="async" src="https://blog.facity.com.br/wp-content/uploads/2023/07/exemplo-de-variaveis-6.png" alt="" class="wp-image-1430" width="917" height="521" srcset="https://blog.facity.com.br/wp-content/uploads/2023/07/exemplo-de-variaveis-6.png 887w, https://blog.facity.com.br/wp-content/uploads/2023/07/exemplo-de-variaveis-6-300x170.png 300w, https://blog.facity.com.br/wp-content/uploads/2023/07/exemplo-de-variaveis-6-768x436.png 768w, https://blog.facity.com.br/wp-content/uploads/2023/07/exemplo-de-variaveis-6-720x409.png 720w" sizes="(min-width: 960px) 75vw, 100vw" /></figure>\n\n\n\n<p class="has-small-font-size">       6. <strong>[webappurl]</strong>: Essa vari\xe1vel cont\xe9m a URL do aplicativo.</p>\n\n\n\n<figure class="wp-block-image size-full is-resized"><img style="max-width: 100%; height: auto;" loading="lazy" decoding="async" src="https://blog.facity.com.br/wp-content/uploads/2023/07/exemplo-de-variaveis-7.png" alt="" class="wp-image-1431" width="916" height="603" srcset="https://blog.facity.com.br/wp-content/uploads/2023/07/exemplo-de-variaveis-7.png 762w, https://blog.facity.com.br/wp-content/uploads/2023/07/exemplo-de-variaveis-7-300x197.png 300w, https://blog.facity.com.br/wp-content/uploads/2023/07/exemplo-de-variaveis-7-720x473.png 720w" sizes="(min-width: 960px) 75vw, 100vw" /></figure>\n\n\n\n<p class="has-small-font-size">    7. <strong>[sendername]</strong>: Utilize essa vari\xe1vel para obter o nome informado pelo cliente atrav\xe9s do WhatsApp.</p>\n\n\n\n<figure class="wp-block-image size-full is-resized"><img style="max-width: 100%; height: auto;" loading="lazy" decoding="async" src="https://blog.facity.com.br/wp-content/uploads/2023/07/exemplo-de-variaveis-8.png" alt="" class="wp-image-1432" width="920" height="536" srcset="https://blog.facity.com.br/wp-content/uploads/2023/07/exemplo-de-variaveis-8.png 815w, https://blog.facity.com.br/wp-content/uploads/2023/07/exemplo-de-variaveis-8-300x174.png 300w, https://blog.facity.com.br/wp-content/uploads/2023/07/exemplo-de-variaveis-8-768x447.png 768w, https://blog.facity.com.br/wp-content/uploads/2023/07/exemplo-de-variaveis-8-720x419.png 720w" sizes="(min-width: 960px) 75vw, 100vw" /></figure>\n\n\n\n<p class="has-small-font-size"><strong>Passo 5: </strong>N\xe3o se esque\xe7a de salvar</p>\n\n\n\n<p class="has-small-font-size">Ap\xf3s criar todas as suas auto respostas com as vari\xe1veis desejadas, clique em <strong>&#8220;SALVAR&#8221; </strong>para garantir que todo o trabalho feito seja armazenado corretamente e n\xe3o se perca.</p>\n\n\n\n<p class="has-small-font-size">Agora voc\xea est\xe1 pronto para utilizar as novas vari\xe1veis em seu bot e fornecer informa\xe7\xf5es atualizadas de forma simples e eficiente. Aproveite esses recursos para tornar a experi\xeancia dos seus clientes ainda melhor!</p>\n\n\n\n<p class="has-small-font-size">Esperamos que este passo a passo tenha sido \xfatil para voc\xea. Se tiver alguma d\xfavida ou quiser compartilhar suas experi\xeancias, deixe um coment\xe1rio abaixo. At\xe9 a pr\xf3xima!</p>\n\n'}})})})}function m(s={}){const{wrapper:e}={...(0,t.R)(),...s.components};return e?(0,o.jsx)(e,{...s,children:(0,o.jsx)(c,{...s})}):c()}},8453:(s,e,a)=>{a.d(e,{R:()=>i,x:()=>p});var o=a(6540);const t={},n=o.createContext(t);function i(s){const e=o.useContext(n);return o.useMemo((function(){return"function"==typeof s?s(e):{...e,...s}}),[e,s])}function p(s){let e;return e=s.disableParentContext?"function"==typeof s.components?s.components(t):s.components||t:i(s.components),o.createElement(n.Provider,{value:e},s.children)}}}]);